public void testTypeHierarchy(){Manager andy=new Manager();andy.userid="andy";andy.startDate=2005;andy.minions=new Employee[]{new Employee("inder",2007),new Employee("joel",2006),new Employee("jesse",2006)};CEO eric=new CEO();eric.userid="eric";eric.startDate=2001;eric.assistant=new Employee("jerome",2006);eric.minions=new Employee[]{new Employee("larry",1998),new Employee("sergey",1998),andy};Gson gson=new GsonBuilder().registerTypeHierarchyAdapter(Employee.class,new EmployeeAdapter()).setPrettyPrinting().create();Company company=new Company();company.ceo=eric;String json=gson.toJson(company,Company.class);assertEquals("{
" + "  "ceo": {
" + "    "userid": "eric",
"+ "    "startDate": 2001,
"+ "    "minions": [
"+ "      {
"+ "        "userid": "larry",
"+ "        "startDate": 1998
"+ "      },
"+ "      {
"+ "        "userid": "sergey",
"+ "        "startDate": 1998
"+ "      },
"+ "      {
"+ "        "userid": "andy",
"+ "        "startDate": 2005,
"+ "        "minions": [
"+ "          {
"+ "            "userid": "inder",
"+ "            "startDate": 2007
"+ "          },
"+ "          {
"+ "            "userid": "joel",
"+ "            "startDate": 2006
"+ "          },
"+ "          {
"+ "            "userid": "jesse",
"+ "            "startDate": 2006
"+ "          }
"+ "        ]
"+ "      }
"+ "    ],
"+ "    "assistant": {
"+ "      "userid": "jerome",
"+ "      "startDate": 2006
"+ "    }
"+ "  }
"+ "}",json);Company copied=gson.fromJson(json,Company.class);assertEquals(json,gson.toJson(copied,Company.class));assertEquals(copied.ceo.userid,company.ceo.userid);assertEquals(copied.ceo.assistant.userid,company.ceo.assistant.userid);assertEquals(copied.ceo.minions[0].userid,company.ceo.minions[0].userid);assertEquals(copied.ceo.minions[1].userid,company.ceo.minions[1].userid);assertEquals(copied.ceo.minions[2].userid,company.ceo.minions[2].userid);assertEquals(((Manager)copied.ceo.minions[2]).minions[0].userid,((Manager)company.ceo.minions[2]).minions[0].userid);assertEquals(((Manager)copied.ceo.minions[2]).minions[1].userid,((Manager)company.ceo.minions[2]).minions[1].userid);}

public void testEmptyMapField(){ClassWithMap obj=new ClassWithMap();obj.map=new LinkedHashMap<String,Integer>();String json=gson.toJson(obj);assertTrue(json.contains("{
  "map": {},
  "value": 2
}"));}

public void testHelloWorld()throws IOException {String json="{
" + "   "hello": true,
" + "   "foo": ["world"]
"+ "}";JsonReader reader=new JsonReader(reader(json));reader.beginObject();assertEquals("hello",reader.nextName());assertEquals(true,reader.nextBoolean());assertEquals("foo",reader.nextName());reader.beginArray();assertEquals("world",reader.nextString());reader.endArray();reader.endObject();assertEquals(JsonToken.END_DOCUMENT,reader.peek());}

