/** * From bug report http://code.google.com/p/google-gson/issues/detail?id=204*/public void testSerializeMaps(){Map<String,Object> map=new LinkedHashMap<String,Object>();map.put("a",12);map.put("b",null);LinkedHashMap<String,Object> innerMap=new LinkedHashMap<String,Object>();innerMap.put("test",1);innerMap.put("TestStringArray",new String[]{"one","two"});map.put("c",innerMap);assertEquals("{"a":12,"b":null,"c":{"test":1,"TestStringArray":["one","two"]}}",new GsonBuilder().serializeNulls().create().toJson(map));assertEquals("{
  "a": 12,
  "b": null,
  "c": " + "{
    "test": 1,
    "TestStringArray": " + "[
      "one",
      "two"
    ]
  }
}",new GsonBuilder().setPrettyPrinting().serializeNulls().create().toJson(map));assertEquals("{"a":12,"c":{"test":1,"TestStringArray":["one","two"]}}",new GsonBuilder().create().toJson(map));assertEquals("{
  "a": 12,
  "c": " + "{
    "test": 1,
    "TestStringArray": " + "[
      "one",
      "two"
    ]
  }
}",new GsonBuilder().setPrettyPrinting().create().toJson(map));innerMap.put("d","e");assertEquals("{"a":12,"c":{"test":1,"TestStringArray":["one","two"],"d":"e"}}",new Gson().toJson(map));}
